import React from "react";
import faceImage from "../assets/Images/face.png";

export default function comments() {
  return (
    <div className="conv__comment">
      <div className="conv__comment-left">
        <img src={faceImage} />
      </div>
      <div className="conv__comment-right">
        <div className="conv__comment-right-top">
          <p className="conv__comment-right-top-name">daniel</p>
          <p className="conv__comment-right-top-date">02/11/2020</p>
        </div>
        <div className="conv__comment-paragraph">
          <p className="conv__comment-paragraph-text">sdfasdfasf</p>
          <button className="conv__delete-button"></button>
        </div>
      </div>
    </div>
  );
}
